import Animate from "animate.css-react/build";
import "animate.css/animate.css";
function MainPageAnimation(props){
  return (
    <Animate
      appear="fadeInUP"
      leave="fadeOutUp"
      durationAppear={1000}
      durationLeave={1000}
      component="div"
    >
      {props.children}
    </Animate>
  );
};
export default MainPageAnimation;
